import React from "react";
function Nav(props) {
  console.log("nav props", props);
  function toggleTheme(theme) {
    props.setMyTheme(theme === "light" ? "dark" : "light");
  }

  return (
    <div className="navbar">
      {/* <div className="aicon-menu"></div> */}
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("home");
        }}
      >
        {/* <svg className="logo" viewBox="0 0 59 42">
          <path d="M4,38H43L23.5,4ZM43,4V31l4,7h8V4Z" />
        </svg> */}

        <svg className="logo" viewBox="0 0 56 56">
          <title>ai1</title>
          <path d="M18.93,34.8a13.66,13.66,0,0,0,1.81.74,15.51,15.51,0,0,0,4.87.79c5.15,0,9.46-2.55,12-4.49l3.79,13.78h0l.55,2H44L38.77,28.49,33.6,9.68,18.35,32.1c-4.84-3.48-4.69-9.77-4.67-10.09l-2-.08c0,.09-.24,7.69,5.54,11.83L7.8,47.62h2.41l1.37-2h0ZM32.82,14.38,37,29.73c-2.76,2.24-8.86,6.15-15.67,3.91a11.83,11.83,0,0,1-1.3-.52Z" />
        </svg>
      </div>
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("dataViz");
        }}
      >
        DataViz
      </div>
      <div
        className="nav-link"
        onClick={() => {
          props.poMansRouting("portfolio");
        }}
      >
        Portfolio
      </div>
      <div
        className="sunlight-nighttime "
        onClick={() => toggleTheme(props.myTheme)}
      >
        <span className="mr-1">Theme</span>
        {props.myTheme === "light" && <div className="aicon-sun-outline"></div>}
        {props.myTheme === "dark" && <div className="aicon-moon"></div>}
      </div>
    </div>
  );
}

export default Nav;
